import PSXP_XMLGEN:*;

class X_BiPub_QRCode
   method GetCurrentJobURL(&InRec_X_EMPL_ORG_VW As Record) Returns string;
   method genXMLFile(&InEmplid As string);
   method GenXMLRowset(&InEmplid As string) Returns Rowset;
   method GenXMLString(&InRowset As Rowset) Returns string;

   method PopXMLFiletoTab();

private

   instance string &XMLFilePath;
   instance string &Filename;


end-class;


method PopXMLFiletoTab

   Local integer &retcode;
   &retcode = PutAttachment(URL.HCSC_ADHOC_NOTIF_ATT, &Filename, &XMLFilePath);
   CommitWork();
   &retcode = ViewAttachment(URL.HCSC_ADHOC_NOTIF_ATT, &Filename, &Filename);

end-method;

method genXMLFile
   /+ &InEmplid as String +/

   &Filename = %UserId | "_Empl_Org.xml";
   Local File &XML_File = GetFile(&Filename, "W", "UTF8");


   Local Rowset &RS_PERSONAL_DATA = %This.GenXMLRowset(&InEmplid);
   Local string &Str_XML = %This.GenXMLString(&RS_PERSONAL_DATA);


   &XML_File.WriteLine(&Str_XML);

   /* save file name and path for publishing */
   &XMLFilePath = &XML_File.Name;
   &XML_File.Close();



end-method;

method GenXMLString
   /+ &InRowset as Rowset +/
   /+ Returns String +/

   Local PSXP_XMLGEN:RowSetDS &oXML_GENERATOR = create psxp_xmlgen:RowSetDS();

   Local string &XML_String = &oXML_GENERATOR.getXMLData(&InRowset, "");

   Return &XML_String;

end-method;

method GenXMLRowset
   /+ &InEmplid as String +/
   /+ Returns Rowset +/

   Local Rowset &RS_X_EMPL_ORG_VW = CreateRowset(Record.X_EMPL_ORG_VW);
   Local Rowset &RS_PERSONAL_DATA = CreateRowset(Record.PERSONAL_DATA, &RS_X_EMPL_ORG_VW);

   Local integer &i, &j;

   /* gen data */
   &RS_PERSONAL_DATA.Fill("Where emplid = :1", &InEmplid);
   For &i = 1 To &RS_PERSONAL_DATA.ActiveRowCount
      &RS_X_EMPL_ORG_VW = &RS_PERSONAL_DATA(&i).GetRowset(Scroll.X_EMPL_ORG_VW);
      &RS_X_EMPL_ORG_VW.Fill("where emplid = :1 ", &RS_PERSONAL_DATA(&i).PERSONAL_DATA.EMPLID.Value);

      For &j = 1 To &RS_X_EMPL_ORG_VW.ActiveRowCount
         &RS_X_EMPL_ORG_VW(&j).X_EMPL_ORG_VW.PTDM_LINK.Value = "<![CDATA[" | EncodeURL(%This.GetCurrentJobURL(&RS_X_EMPL_ORG_VW(&j).GetRecord(Record.X_EMPL_ORG_VW))) | "]]>";



      End-For;

   End-For;

   Return &RS_PERSONAL_DATA;

end-method;


method GetCurrentJobURL
   /+ &InRec_X_EMPL_ORG_VW as Record +/
   /+ Returns String +/

   Local string &Str_URL;

   &Str_URL = GenerateComponentPortalURL(%Portal, %Node, MenuName."ADMINISTER_WORKFORCE_(GBL)", "GBL", Component.JOB_DATA_CURRENT, Page.JOB_DATA1, "C", &InRec_X_EMPL_ORG_VW);

   Return &Str_URL;
end-method;

