import PSXP_XMLGEN:*;
import PSXP_RPTDEFNMANAGER:*;

class X_QRCode_Print
   method genXMLFile(&InRecord As Record);
   method GenXMLRowset(&InRecord As Record) Returns Rowset;
   method GenXMLString(&InRowset As Rowset) Returns string;

   method GenBiPubReport();
   method PopXMLFiletoTab();

private

   instance string &XMLFilePath;
   instance string &Filename;
   instance string &Str_Template_ID;

end-class;


method PopXMLFiletoTab

   Local integer &retcode;
   &retcode = PutAttachment(URL.HCSC_ADHOC_NOTIF_ATT, &Filename, &XMLFilePath);
   CommitWork();
   &retcode = ViewAttachment(URL.HCSC_ADHOC_NOTIF_ATT, &Filename, &Filename);

end-method;

method genXMLFile
   /+ &InRecord as Record +/

   &Filename = %UserId | "_QRCode_Print.xml";
   Local File &XML_File = GetFile(&Filename, "W", "UTF8");

   /* we need a rowset for the rowset xml generator to work */
   Local Rowset &RS_XML_Data = %This.GenXMLRowset(&InRecord);

   Local string &Str_XML = %This.GenXMLString(&RS_XML_Data);

   /* set the template */
   If &InRecord.X_QRCODE_TYPE.Value = "P" Then
      &Str_Template_ID = "PDF417";
   Else
      &Str_Template_ID = "QRCODE";
   End-If;

   &XML_File.WriteLine(&Str_XML);

   /* save file name and path for publishing */
   &XMLFilePath = &XML_File.Name;
   &XML_File.Close();

   %This.PopXMLFiletoTab();

end-method;

method GenXMLString
   /+ &InRowset as Rowset +/
   /+ Returns String +/

   Local PSXP_XMLGEN:RowSetDS &oXML_GENERATOR = create psxp_xmlgen:RowSetDS();

   Local string &XML_String = &oXML_GENERATOR.getXMLData(&InRowset, "");

   Return &XML_String;

end-method;

method GenXMLRowset
   /+ &InRecord as Record +/
   /+ Returns Rowset +/


   /* wrap the qrcode payload in CDATA tag */


   Local Rowset &RS_X_QRCODE_WRK = CreateRowset(Record.X_QRCODE_WRK);

   &InRecord.CopyFieldsTo(&RS_X_QRCODE_WRK(1).GetRecord(Record.X_QRCODE_WRK));

   Local Field &fld_XML_Data = &RS_X_QRCODE_WRK(1).GetRecord(Record.X_QRCODE_WRK).X_QRCODE_DATA;

   If Upper(Substring(&fld_XML_Data.Value, 1, 4)) = "HTTP" Then
      &fld_XML_Data.Value = EncodeURL(&fld_XML_Data.Value);
   End-If;

   If Find("&", &fld_XML_Data.Value) > 0 Then
      &fld_XML_Data.Value = "<![CDATA[" | &fld_XML_Data.Value | "]]>";
   End-If;

   Return &RS_X_QRCODE_WRK;

end-method;

method GenBiPubReport

   Local PSXP_RPTDEFNMANAGER:ReportDefn &oXML_PUB;


   /* Create the second pdf doc */
   &oXML_PUB = create PSXP_RPTDEFNMANAGER:ReportDefn("X_QRCODEPRNT");
   &oXML_PUB.Get();
   &oXML_PUB.SetRuntimeDataXMLFile(&XMLFilePath);
   &oXML_PUB.ProcessReport(&Str_Template_ID, "", %Date, "");
   CommitWork();
   &oXML_PUB.DisplayOutput();



end-method;
